import './OverlayMenu.css';

function OverlayMenu(props) {
    return (
        <div id="side-menu">
            <div onClick={() => console.log("clicked overlay")} id="side-menu__overlay" />
            <div onClick={() => console.log("clicked content")} id="side-menu__content"><button onClick={console.log("what is going on")}>here</button>{props.content}</div>
        </div>
    );
}

export default OverlayMenu;
